import React from "react";
import { Col, Row, Container } from "../components/Grid";
import HomeLaunchers from "../components/HomeLaunchers";

const Home = () => {
  return (
    <Container fluid>
      <div class="pageHeaders"><h1>Home</h1></div>
      <HomeLaunchers/>
    </Container>
  );
};

export default Home;
